    "2016-08-05T08:15:11.610244",nt"name": "alaska-peninsula-becharof-national-wildlife-refuge-complex-annual-narrative-report-calen-1-a0ae9",nt"isopen":
    false,nt"url": null,nt"notes": "This annual narrative report for Alaska
    Peninsula and Becharof NWRs outlines Refuge accomplishments during the 1992 calendar
    year. The report begins with a summary of the year's highlights and weather conditions.
    Land acquisition is covered. The report includes a planning section which discusses
    management planning, public participation, compliance with environmental and cultural
    resource mandates, and research and investigations. Refuge administration is outlined;
    information about personnel, youth programs, manpower programs, volunteer programs,
    funding, and safety is given. Habitat management is also covered; subjects include
    wetlands, fire management, and wilderness areas. The wildlife section of the report
    discusses waterfowl, shorebirds, game mammals, fisheries resources, surplus animal
    disposal, and marking and bird banding. The public uses of the Refuge described
    in this report include outdoor classrooms, interpretive programs, hunting, fishing,
    trapping, wildlife observation, outdoor recreation, and law enforcement. The equipment
    and facilities section of the report provides information about new construction,
    rehabilitation, major maintenance, equipment replacement, communication systems,
    computer systems, and energy conservation. Cooperative programs and items of interest
    are provided at the end.",nt"license_title": "License Not Specified",nt"extras":
